import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Login from './Pages/Login/Login';
import home from './Pages/Login/home';
function App() {
  return (

    <>
    <BrowserRouter>
    <Routes>

      <Route path="/" element={<Login />} />
      <Route path="/home" element={<Home />} />

    </Routes>
    </BrowserRouter>
    </>

  );
}

export default App;
